import React from "react";
import { Carousel } from "react-responsive-carousel";
import "react-responsive-carousel/lib/styles/carousel.min.css";

const AutoCarousel = () => {
  return (
    <Carousel
      autoPlay={true}
      infiniteLoop={true}
      stopOnHover={true}
      showThumbs={false}
      className="mb-3"
    >
      <div>
        <img
          src="https://react-responsive-carousel.js.org/assets/1.jpeg"
          alt="img"
        />
      </div>

      <div>
        <img
          src="https://react-responsive-carousel.js.org/assets/1.jpeg"
          alt="img"
        />
      </div>

      <div>
        <img
          src="https://react-responsive-carousel.js.org/assets/1.jpeg"
          alt="img"
        />
      </div>
    </Carousel>
  );
};

export default AutoCarousel;
